findIndex() with async callback with mongoose.findById() inside always returning 0<p>I am creating simple queing system with tickets. The ticket is inserted into array in place of first ticket with visitTime greater than one to be inserted. The array contains only ticketIds, which have to be looked up in Mongo database using mongoose findById(ticketId) method before any comparing.</p>
<p>However after writing below code I noticed, that findIndex() method returns always index 0, whatever the data in the array is. What am I missing?</p>
<p>Here is the code:</p>
<pre><code>
const ticketToInsertTime = convertTime(ticket.visitTime)

const index = que.activeTickets.findIndex(async (ticketId) =&gt; {
    const ticketFromArray = await Ticket.findById(ticketId).exec()
    const ticketTime = convertTime(ticketFromArray?.visitTime!)
    return ticketTime &gt; ticketToInsertTime
})
if (index &lt; 0) {
    que.activeTickets.push(ticket._id)
    que.save()
} else {
    que.activeTickets.splice(index, 0, ticket._id)
    que.save()
}




function convertTime(time: string) {
    const hour = parseInt(time.split(':')[0])
    const minutes = parseInt(time.split(':')[1])

    return (hour * 60 + minutes)
}

</code></pre>

