okhttp not sending header on post request<p>I am trying to send a simple post request to MongoDB using okhttp. Here is the code that I am working with:</p>
<pre><code> try {
                String jsonStr = om.writeValueAsString(postRequest);
                RequestBody body = RequestBody.create(
                        jsonStr, MediaType.parse(&quot;application/json; charset=utf-8&quot;));
                // also attempted with MediaType.parse(&quot;application/json&quot;)

                Request request = new Request.Builder()
                        .url(insertUrl)
                        .addHeader(&quot;api-key&quot;, mongoDbApiKey)
                        // I have tried following ways to add content-type
                        // .addHeader(&quot;Content-Type&quot;, &quot;application/json&quot;)
                        .addHeader(&quot;content-type&quot;, &quot;application/json&quot;)
                        .post(body)
                        .build();

                String req = request.toString();

                OkHttpClient.Builder builder = new OkHttpClient.Builder();
                builder.addInterceptor(new CurlInterceptor(
                        new Logger() {
                            @Override
                            public void log(@NonNull String s) {
                                Log.v(&quot;OK2Curl&quot;, s);
                                // I copied this curl request to postman and it works from postman but for some reason does not work when run from my Android App.
                            }
                        }
                ));

               OkHttpClient client = builder.build();

                client.newCall(request).enqueue(new Callback() {
                    @Override public void onFailure(Call call, IOException e) {
                        e.printStackTrace();
                        Toast.makeText(getActivity(), &quot;Unable to save the data.&quot;,
                                Toast.LENGTH_SHORT).show();
                    }

                    @Override public void onResponse(Call call, Response response) throws IOException {
                        String respString = response.body().string();
                        // respString =&gt; &quot;Header missing: please add content-type: application/json or application/ejson to specify payload data types&quot;
                        if(response.isSuccessful()){
                            Toast.makeText(getActivity(), &quot;Data is saved.&quot;,
                                    Toast.LENGTH_SHORT).show();
                        }
                        else {
                            Toast.makeText(getActivity(), &quot;Unable to save the data.&quot;,
                                    Toast.LENGTH_SHORT).show();
                        }
                    }
                });
            } catch (IOException e) {
                e.printStackTrace();
            }
</code></pre>
<p>However, when the code is run in my Android App it fails with the following error:</p>
<blockquote>
<p>Header missing: please add content-type: application/json or application/ejson to specify payload data types</p>
</blockquote>
<p>The HTTP response error code is 400.</p>
<p>Clearly, I have added a header of content-type using multiple ways and the log outputs a curl request that works in postman. What am I missing here? Does the header get removed somewhere by okhttp or something else?</p>
<p>Version:
okhttp3 version 4.10.0</p>
<p><strong>UPDATE 1</strong></p>
<p>I know that there are three methods to add headers in okhttp. addHeader, header and using headers builder. There is not much difference except the headers and header method override the header that is added when MediaType.parse(&quot;application/json&quot;) is passed to the request on creation. I still get 400 response regardless of the way I add the header to the request.</p>
<p><strong>UPDATE 2</strong></p>
<p>To test my network and parameters such as api-key I have used postman and also Java 11 HttpClient and both methods work.</p>
<pre><code>    HttpRequest request = HttpRequest.newBuilder()
            .POST(HttpRequest.BodyPublishers.ofString(data))
            .uri(URI.create(MONGO_DB_URL))
            .setHeader(&quot;api-key&quot;, API_KEY)
            .setHeader(&quot;Content-Type&quot;, &quot;application/json&quot;)
            .build();
</code></pre>
<p>so this problem seems to be specific to <code>okhttp</code> client.</p>
<p><strong>UPDATE 3</strong></p>
<p>I tried the same scenario using Google's Volley HTTP library and it worked with that. So for now I can make progress on my app without okhttp.</p>

